import React from 'react';
import ResumeForm from './components/ResumeForm';
import './index.css';

function App() {
  return (
    <div className="min-h-screen bg-gray-100">
      <div className="max-w-4xl mx-auto bg-white shadow-lg rounded-lg p-6 mt-6">

        {/* Heading with icon */}
        <div className="flex flex-col items-center">
          <h1 className="text-4xl font-bold text-blue-600 mb-3 flex items-center gap-2 drop-shadow-sm">
            <img
              src="https://cdn-icons-png.flaticon.com/512/1087/1087815.png"
              alt="icon"
              className="w-6 h-6"
            />
            Resume Editor
          </h1>

          {/* Section Links */}
          <nav className="flex gap-10 mb-6">
            <a href="#name" className="text-blue-600 font-medium hover:underline">Name</a>
            <a href="#experience" className="text-blue-600 font-medium hover:underline">Experience</a>
            <a href="#education" className="text-blue-600 font-medium hover:underline">Education</a>
            <a href="#skills" className="text-blue-600 font-medium hover:underline">Skills</a>
          </nav>
        </div>

        <ResumeForm />
      </div>
    </div>
  );
}

export default App;
